import React from 'react';

function References() {
    return (
        <div className="page-container">
            <h2 className="page-title">Bibliography</h2>
            <ul className="references-list">
                <li>Vatican.va. Catechism of the Catholic Church. 2024.</li>
                <li>Statistics Canada. Homelessness in Canada. 2023.</li>
                <li>BibleGateway. Matthew 25:35-40. 2024.</li>
            </ul>
        </div>
    );
}

export default References;
